(props: { pageProps: any; nextPage: any }) => {
  const { nextPage, pageProps } = props;
  const router = useRouter();
  // in index, we need this
  if (router.isReady && router.pathname === "/") {
    const Index = nextPage;
    return <Index {...pageProps} />;
  }
  return (
    <AuthenticationLayout
      overwriteDefaultPages={["signup"]}
      nextPage={nextPage}
      pageProps={pageProps}
    />
  );
}
